import {Link} from "react-router-dom";


function Nav(){


    return(
        <nav>
            <ul>
                <li><Link to="/">Accueil</Link></li>
                <li><Link to="/signin">Se connecter</Link> </li>
                <li><Link to="/signup">S'enregistrer</Link></li>
            </ul>
        </nav>
    )

}

export default Nav;
